INSERT INTO `v1_3fc9a1c0276a0d0ef2dd789220980f007ed90f0717b01f22fd52f4b6abb168a6` VALUES (1007405034, 0.5, "あら。\nこないだぷりぷりして帰った件は\n綺麗さっぱりなかったことにするのね。\nオーケイ、了解よ。", 0, 0, 117531, 1007405, 0, 11, 1, 6);
